INSERT INTO `campaign` (`id`, `slug`, `name`, `name_en`, `description`, `description_en`, `content`, `content_en`, `cover`, `image`, `icon`, `gallery`, `status`, `sort`, `updated_at`, `created_at`, `seo_title`, `seo_keyword`, `seo_description`) VALUES
(1, 'trung-tam-thu-gom-rac-thai-nhua', 'TRUNG TÂM THU GOM RÁC THẢI NHỰA', NULL, '&lt;p&gt;Plastic Bank được thành lập với mục đích làm sạch chất thải từ nhựa trong môi trường và nâng cao nhận thức tái chế cho người dân Việt Nam.&lt;/p&gt;', NULL, '&lt;div class=&quot;default-container margin-lg pitch-landing-page&quot;&gt;\r\n&lt;div class=&quot;campaign-page&quot;&gt;\r\n&lt;div class=&quot;primary&quot;&gt;\r\n&lt;div class=&quot;markdown with-lists&quot;&gt;\r\n&lt;p&gt;The plastic bank is founded with the mission to stop Ocean Plastic by gathering a billion people together to earn money from the waste as well as improve their lives. Extremely poor regions, people are not able to access basic social services and they are suffering from extreme plastic pollution. Hence, the plastic bank is the best solution to prevent the flow of plastic into our oceans, protect the environment and improve the lives of thousands of Vietnam.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;How does it work?&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The people collect the plastic which will be paid by crypto as a pride and will be confirmed through the Plastic Bank application. After collecting, plastic will be categorized, recycled and sold for companies who use recycled products in production instead of new plastic. This will build a sustainable ecosystem when this project links to the philanthropy village. It means that when the parents collected the plastic and received the crypto. This crypto will be accumulated day by day and their students can have enough condition to go to school. Moreover, the disadvantage people can buy food to improve their lives. Our projects aim to build a nationwide sustainable ecosystem in Vietnam in order to share our vision. Not only do Plastic banks protect the environment and increase the recycling rate in Vietnam but they also help to decrease the poverty rate.&lt;/p&gt;\r\n\r\n&lt;p&gt;By improving infrastructure and paying a premium on collected plastic, we believe that if everybody joins hands together and we can save the Earth, save our lives.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;', NULL, NULL, '/upload/images/campaign/img_key_project_3_832x400.jpg', NULL, NULL, 1, 3, '2024-03-07 08:58:23', '2024-01-20 12:23:06', 'TRUNG TÂM THU GOM RÁC THẢI NHỰA', NULL, NULL),
(2, 'm2030', 'M2030', NULL, '&lt;p&gt;Nhằm nâng cao nhận thức và giảm tỷ lệ tử vong của người dân Việt Nam nói riêng và Châu Á nói chung về căn bệnh sốt rét, dự án M2030 được thực hiện với mục tiêu rằng năm 2030 sẽ là năm không còn bệnh sốt rét tồn tại trên thế giới.&lt;/p&gt;', NULL, '&lt;div class=&quot;markdown with-lists&quot;&gt;\r\n&lt;p&gt;Nhằm nâng cao nhận thức và giảm tỷ lệ tử vong của người dân Việt Nam nói riêng và Châu Á nói chung về căn bệnh sốt rét, dự án M2030 được thực hiện với mục tiêu rằng năm 2030 sẽ là năm không còn bệnh sốt rét tồn tại trên thế giới.&lt;/p&gt;\r\n\r\n&lt;p data-wpmeteor-mouseout=&quot;true&quot; data-wpmeteor-mouseover=&quot;true&quot;&gt;Bệnh sốt rét đã cướp đi 500,000 sinh mạng mỗi năm trên toàn thế giới và cứ 2 phút sẽ có 1 đứa trẻ bị chết bởi căn bệnh. Theo thống kê, đã có 200 triệu người chết chỉ trong thế kỷ 20. Ký sinh trùng sốt rét không ngừng phát triển dẫn đến hiện tượng kháng thuốc và đang là mối nguy ngại của sức khỏe cộng đồng toàn cầu nếu không có biện pháp khẩn cấp để ngăn chặn sự lây lan trong khu vực Đông Nam Á.&lt;/p&gt;\r\n\r\n&lt;p data-wpmeteor-mouseout=&quot;true&quot; data-wpmeteor-mouseover=&quot;true&quot;&gt;Dự án M2030 được thành lập với mục đích nâng cao nhận thức của người dân về môi nguy hại mang tên sốt rét để mọi người cùng ngăn chặn và bảo vệ sức khỏe của mình. Ngoải ra, dự án còn tiến hàng gây quỹ để chung tay bài trừ căn bệnh sốt rét ở Châu Á. Đồng thời sẽ phát triển những sản phẩm hoặc dịch vụ mang thương hiệu M2030.&lt;/p&gt;\r\n\r\n&lt;p data-wpmeteor-mouseout=&quot;true&quot; data-wpmeteor-mouseover=&quot;true&quot;&gt;Khi khách hàng mua sản phẩm hoặc trải nghiệm dịch vụ của M2030, 100% khoản đóng góp sẽ được trực tiếp chuyển thẳng đến cho quỹ sốt rét tại nơi được gây quỹ để giúp đỡ những người dân ngăn chặn, bảo vệ và chữa trị bệnh sốt rét.&lt;/p&gt;\r\n\r\n&lt;p&gt;Chúng tôi tin rằng dù chỉ một trường hợp mắc bệnh sốt rét hay tử vong đều là quá nhiều. Y học ngày càng phát triển và chúng ta sẽ làm được. Hãy tưởng tượng rằng tất cả mạng sống đều được cứu và tương lai của họ sẽ không phải lo sợ sẽ mắc phải căn bệnh sốt rét này nữa. Cùng nhau chúng ta sẽ tạo nên lịch sử và đánh bại bệnh sốt rét.&lt;/p&gt;\r\n&lt;/div&gt;', NULL, NULL, '/upload/images/campaign/img_key_project_2_832x400.jpg', NULL, NULL, 1, 2, '2024-03-06 14:27:50', '2024-01-20 12:24:07', 'Hướng Dẫn Thiết Kế Cà Phê Theo Kiểu Sân Vườn:', NULL, NULL),
(3, 'lang-thien-nguyen', 'LÀNG THIỆN NGUYỆN', NULL, '&lt;p&gt;Mô hình &amp;ldquo;Làng Thiện Nguyện&amp;rdquo; được xây dựng trên 60 tỉnh thành Việt Nam sẽ bao gồm cơ sở y tế (Bệnh viện hoặc Phòng Khám Đa Khoa) và cơ sở giáo dục từ Tiểu học tới THPT đảm bảo chất lượng giảng dạy và chi phí phù hợp với thu nhập của người dân địa phương.&lt;/p&gt;', NULL, '&lt;p&gt;Mô hình &amp;ldquo;Làng Thiện Nguyện&amp;rdquo; được xây dựng trên 60 tỉnh thành Việt Nam sẽ bao gồm cơ sở y tế (Bệnh viện hoặc Phòng Khám Đa Khoa) và cơ sở giáo dục từ Tiểu học tới THPT đảm bảo chất lượng giảng dạy và chi phí phù hợp với thu nhập của người dân địa phương. Bên cạnh đó, Làng còn có Viện dưỡng lão và Cô Nhi viện nuôi dưỡng những người già cô đơn và trẻ em mồ côi có hoàn cảnh khó khăn từ nguồn kinh phí phúc lợi xã hội của Bệnh viện và Trường học. One Health Foundation sẽ chịu trách nhiệm quyên góp, gây quỹ để xây dựng và vận hành dự án.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;strong&gt;Quy mô của dự án:&lt;/strong&gt;&lt;br /&gt;\r\n	1.&amp;nbsp; Bệnh viện đa khoa cộng đồng có quy mộ từ 200 tới 400 giường được trang bị các thiết bị kỹ thuật cao. Bệnh viện hoạt động theo cơ chế của bệnh viện tư nhân phục vụ nhu cầu khám, chữa bệnh tại địa phương với chi phí phù hợp với thu nhập của địa phương. Lợi nhuận từ bệnh viện sẽ dành để chăm sóc sức khỏe cho nạn nhân chất độc da cam, người già neo đơn, trẻ em cơ nhỡ và các hộ nghèo của địa phương.&lt;br /&gt;\r\n	2. Trường phổ thông cộng đồng từ cấp tiểu học tới trung học phổ thông với các trang thiết bị giáo dục hiện đại. Các trường học hoạt động theo cơ chế trường dân lập với chi phí phù hợp với thu nhập của địa phương. Lợi nhuận từ trường học sẽ dành để trao các suất học bổng và miễn học phí cho trẻ em mồ côi và có hoàn cảnh khó khăn tại địa phương .&lt;br /&gt;\r\n	3. Viện dưỡng lão có quy mô từ 150 &amp;ndash; 200 giường, hoạt động theo cơ chế viện dưỡng lão tư nhân cung cấp dịch vụ cho người cao tuổi tại địa phương.&lt;br /&gt;\r\n	4. Viện dưỡng lão cộng đồng và cô nhi viện có quy mô nuôi dưỡng, chăm sóc từ 100 tới 200 người già neo đơn và trẻ mồ côi từ nguồn kinh phí của các hạng mục khác trong dự án và quyên góp từ cộng đồng.&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Với sứ mệnh lấy giáo dục và y tế làm trọng tâm, mô hình &amp;rdquo;Làng Thiện Nguyện&amp;rdquo; được xây dựng nhằm mục đích:&lt;/strong&gt;&lt;br /&gt;\r\n	1. Giúp người dân địa phương tiếp cận các dịch vụ y tế, giáo dục dễ dàng thuận lợi hơn.&lt;br /&gt;\r\n	2. Nâng cao chất lượng các dịch vụ chăm sóc sức khỏe và giáo dục tại địa phương.&lt;br /&gt;\r\n	3. Giảm tải cho các cơ sở y tế và giáo dục các thành phố trung ương&lt;br /&gt;\r\n	4. Xử lý các vấn đề về ô nhiễm môi trường, tạo ra năng lượng sạch tại địa phương&lt;br /&gt;\r\n	5. Tạo ra một hệ sinh thái bền vững trợ giúp những hoàn cảnh khó khăn tại địa phương.&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Dự án đặt mục tiêu xây dựng 1 &amp;ldquo;Làng Thiện Nguyện&amp;rdquo; cho mỗi tỉnh thành trên toàn lãnh thổ Việt Nam theo từng giai đoạn.&lt;/strong&gt;&lt;br /&gt;\r\n	1. Giai đoạn 1 từ 2019 tới 2020: Gây quỹ và xây dựng Làng Thiện Nguyện đầu tiên.&lt;br /&gt;\r\n	2. Giai đoạn 2 từ 2021 tới 2025: vận hành Làng Thiện Nguyện số 1 và xây dựng 5 Làng Thiện Nguyện ở các Tỉnh Miền Nam và Nam Trung Bộ.&lt;br /&gt;\r\n	3. Giai Đoạn 3: Xây dựng Làng Thiện Nguyện cho các tỉnh phía Bắc.&lt;/li&gt;\r\n&lt;/ul&gt;', NULL, NULL, '/upload/images/campaign/lang_thien_nguyen.png', NULL, NULL, 1, 1, '2024-03-06 16:54:45', '2024-01-23 11:21:23', 'aaa', NULL, NULL),
(4, 'y-te', 'Y tế', NULL, '&lt;p&gt;Cơ sở y tế tại các vùng cao và các tỉnh gần biên giới còn thiếu hụt trầm trọng, khả năng tiếp cận các dịch vụ xã hội còn hạn chế. Đa số những người dân địa phương nơi đây phải đi một quãng khá xa để lên tận bệnh viện trung ương để khám chữa trị. Điều này dẫn đến tình trạng quá tải tại các trung tâm y tế và bệnh viện.&lt;/p&gt;', NULL, '&lt;p&gt;Cơ sở y tế tại các vùng cao và các tỉnh gần biên giới còn thiếu hụt trầm trọng, khả năng tiếp cận các dịch vụ xã hội còn hạn chế. Đa số những người dân địa phương nơi đây phải đi một quãng khá xa để lên tận bệnh viện trung ương để khám chữa trị. Điều này dẫn đến tình trạng quá tải tại các trung tâm y tế và bệnh viện.&lt;/p&gt;\r\n\r\n&lt;p&gt;Hiểu rõ được sự thiếu hụt và tình trạng của người dân địa phương, chúng tôi thực hiện dự án này với mong muốn để mọi người đều có thể tiếp cận được với các dịch vụ y tế. Bệnh viện là một trong những mô hình thuộc dự án Làng Thiện Nguyện. Tại đây chúng tôi đầy đủ các thiết bị y tế để phục vụ cho người dân địa phương với quyền lợi phù hợp với mức sống của người dân nơi đây.&lt;/p&gt;\r\n\r\n&lt;h4&gt;&amp;nbsp;&lt;/h4&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Thực Trạng Hiện Tại Của Việt Nam&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;p&gt;Bác sĩ và y tá tại các bệnh viện tỉnh vẫn còn thiếu hụt trầm trọng vì chính sách chưa đủ thu hút các nhân lực. Thiết bị y tế còn hạn chế nên người dân địa phương trong khi các bệnh viện Chợ Rẫy hay Ung Bứu lại bị quá tải.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Tác Động Của Dự Án Lên Cuộc Sống Người Dân&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;p&gt;Chúng tôi tin rằng với mô hình bệnh viện đầy đủ các thiết bị y tế và mức giá phù hợp với thu nhập hàng tháng của người dân, đây là 1 phương pháp hiệu quả cho các chính quyền khi không phải đau đầu suy nghĩ làm sao để đưa ra những chính sách thu hút nhân sự và giải quyết vấn đề quá tải bệnh viện. Người dân địa phương sẽ được tiếp cận với dịch vụ y tế chất lượng hơn.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;title&quot;&gt;\r\n&lt;h3&gt;&lt;span style=&quot;line-height:1;&quot;&gt;CƠ SỞ Y TẾ&lt;/span&gt;&lt;/h3&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height:1;&quot;&gt;Bệnh Viện Và Trung Tâm Y Tế&lt;/span&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;btgrid&quot;&gt;\r\n&lt;div class=&quot;row row-1&quot;&gt;\r\n&lt;div class=&quot;col-md-6&quot;&gt;\r\n&lt;div class=&quot;content&quot;&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/upload/images/campaign/medical_img01.jpg&quot; style=&quot;width: 100%;&quot; /&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;col-md-6&quot;&gt;\r\n&lt;div class=&quot;content&quot;&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/upload/images/campaign/medical_img02.jpg&quot; style=&quot;width: 100%;&quot; /&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;p&gt;Bệnh viện đa khoa cộng đồng có quy mô từ 200 tới 400 giường được trang bị các thiết bị kỹ thuật cao. Bệnh viện hoạt động theo cơ chế của bệnh viện tư nhân phục vụ nhu cầu khám, chữa bệnh tại địa phương với chi phí phù hợp với thu nhập của địa phương. Lợi nhuận từ bệnh viện sẽ dành để chăm sóc sức khỏe cho nạn nhân chất độc da cam, người già neo đơn, trẻ em cơ nhỡ và các hộ nghèo của địa phương.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;title&quot;&gt;\r\n&lt;h3&gt;VIỆN DƯỠNG LÃO&lt;/h3&gt;\r\n\r\n&lt;p&gt;Viện Dưỡng Lão Và Cô Nhi Viện&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;btgrid&quot;&gt;\r\n&lt;div class=&quot;row row-1&quot;&gt;\r\n&lt;div class=&quot;col-md-6&quot;&gt;\r\n&lt;div class=&quot;content&quot;&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/upload/images/campaign/20160523-n7.jpg&quot; style=&quot;width: 100%;&quot; /&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;col-md-6&quot;&gt;\r\n&lt;div class=&quot;content&quot;&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/upload/images/campaign/lao200619-15613439822511054707348.jpg&quot; style=&quot;width: 100%;&quot; /&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;p style=&quot;margin-left: 40px; text-align: justify;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left: 40px; text-align: justify;&quot;&gt;Viện dưỡng lão có quy mô từ 150 &amp;ndash; 200 giường, hoạt động theo cơ chế viện dưỡng lão tư nhân cung cấp dịch vụ cho người cao tuổi tại địa phương.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left: 40px; text-align: justify;&quot;&gt;Viện dưỡng lão cộng đồng và cô nhi viện có quy mô nuôi dưỡng, chăm sóc từ 100 tới 200 người già neo đơn và trẻ mồ côi từ nguồn kinh phí của các hạng mục khác trong dự án và quyên góp từ cộng đồng.&lt;/p&gt;', NULL, NULL, '/upload/images/campaign/medical_banner.jpg', NULL, NULL, 1, 4, '2024-03-07 10:44:17', '2024-03-07 09:03:59', 'Y tế', NULL, NULL);
