(4, 'hoat-dong', 'post', 'Hoạt động', NULL, '&lt;p&gt;Bên cạnh 3 dự án chính, quỹ từ thiện Sức khỏe là số 1 vẫn tham gia các hoạt động thiện nguyện để hỗ trợ và giúp đỡ những hoàn cảnh không may mắn ở Việt Nam&lt;/p&gt;', NULL, NULL, NULL, NULL, '/upload/images/news/banner_activities.jpg', NULL, 0, 0, 0, 4, 1, 'Hoạt động', NULL, NULL, '2024-03-04 13:16:08', '2024-03-04 13:21:58');
