INSERT INTO `page` (`id`, `slug`, `title`, `title_en`, `description`, `description_en`, `content`, `content_en`, `content2`, `content2_en`, `cover`, `image`, `icon`, `sort`, `created_at`, `updated_at`, `status`, `template`, `parent`, `seo_title`, `seo_keyword`, `seo_description`) VALUES
(2, 'about', 'Chúng tôi là ai?', 'Who are we?', '<p>Chúng tôi là ai?</p>', NULL, '<p>Quỹ từ thiện sức khỏe là số 1 hay One Health Foundation (OHF) là một tổ chức phi chính phủ, được khấu trừ thuế và được cấp phép hoạt động tại Việt Nam. Quỹ được thành lập vào năm 2018 bởi ông Nguyễn Huỳnh Đăng Khoa. OHF hoạt động với mục tiêu giúp người dân thoát nghèo bền vững bằng cách tạo cơ hội cho những người dân ở vùng xa đều có khả năng tiếp cận với các dịch vụ xã hội cơ bản về y tế và giáo dục thông qua các dự án của quỹ. Trong tương lai, những chương trình của OHF sẽ tiếp cận và giúp đỡ hàng ngàn hoàn cảnh khó khăn ở 63 tỉnh thành mỗi năm.</p>\r\n\r\n<div class=\"mission_dot\"><span>&nbsp;</span></div>\r\n\r\n<h3 style=\"text-align: center;\">Sứ mệnh</h3>\r\n\r\n<p>OHF thực hiện những dự án nhằm nâng cao các cơ hội được chăm sóc y tế và giáo dục phổ thông tới những người có hoàn cảnh kinh tế khó khăn tại Việt Nam. Đồng thời chúng tôi sẽ tìm ra các giải pháp khắc phục các vấn đề về ô nhiễm môi trường sống cho cộng đồng. Thông qua các dự án chúng tôi tạo điều kiện để thế hệ trẻ Việt Nam phát triển tối đa tiềm năng của họ</p>\r\n\r\n<h3 style=\"text-align: center;\">&nbsp;</h3>\r\n\r\n<h3 style=\"text-align: center;\">Tầm nhìn</h3>\r\n\r\n<p>OHF tập trung xây dựng một hệ thống y tế cộng đồng bền vững trên toàn lãnh thổ Việt Nam để đảm bảo cho tất cả người dân đều được chăm sóc về y tế, giáo dục hiệu quả với chi phí phù hợp và sống trong môi trường lành mạnh.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<p>[section section=&quot;1&quot; section_name=&quot;section_about&quot;]</p>', NULL, '<div class=\"container\">\r\n<div class=\"service-list\">\r\n<div class=\"item-service\">\r\n<div class=\"thumb\"><img src=\"/upload/images/page/about2.jpg\" style=\"width: 100%;\" /></div>\r\n\r\n<div class=\"content\">\r\n<h5>BTChem Sustainable Companion</h5>\r\n\r\n<div class=\"animation-line line-bg\">\r\n<div class=\"line\">&nbsp;</div>\r\n</div>\r\n\r\n<p>Proud to be a unit operating in the interior wood painting industry, having been with customers for more than 30 years. Through ups and downs and challenges, we have built respectful relationships with customers, and especially, with small units in the past, which have now become strong companies, close friend.</p>\r\n\r\n<p>Proud of this tradition, BTChem not only views customers as business partners, but also as companions. Thanks to the consensus and support from customers, we have had the opportunity to develop and affirm our position in the industry.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"item-service\">\r\n<div class=\"thumb order-md-1\"><img src=\"/upload/images/page/about3.jpg\" style=\"width: 100%;\" /></div>\r\n\r\n<div class=\"content\">\r\n<h5>BT Chem&#39;s service spirit</h5>\r\n\r\n<div class=\"animation-line\">\r\n<div class=\"line\">&nbsp;</div>\r\n</div>\r\n\r\n<p>Not only stopping at finding new customers, but also aiming to maintain and develop sustainable relationships with current customers. BTChem considers customers as &nbsp;close friends, companions on the common path of success. BTChem respects and cherishes every perspective and opinion from customers, and always listens to create the best solutions together.</p>\r\n\r\n<p>Confident in quality and a solid vision, BTchem determines its goal of becoming a strong company and a company with the highest potential and prospects in the industry. We are committed to constantly innovating, improving product and service quality, accompanying customers in every project, and always meeting their hopes and expectations.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', '/upload/images/page/banner_who_we_are.jpg', '', 2, NULL, '2024-03-05 11:20:09', 1, 'page', 'root', 'Về chúng tôi', NULL, NULL),
(5, 'contact', 'Liên hệ', 'Contact', NULL, NULL, '<div class=\"btgrid container\">\r\n<div class=\"row row-1\">\r\n<div class=\"col-md-12\">\r\n<div class=\"content\">\r\n<p>Cảm ơn sự quan tâm của bạn dành cho tổ chức của chúng tôi. Nếu như có bất cứ thắc mắc nào về các hoạt động cũng như thông tin về Quỹ, hãy gửi tin nhắn cho chúng tôi. Chúng tôi luôn chào đón và hồi đáp cho sự thắc mắc của bạn.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/page/map_google.jpg\" style=\"width: 100%;\" /></p>', NULL, NULL, NULL, '', '/upload/images/page/banner_contact.jpg', '', 4, '2022-02-17 15:44:57', '2024-03-09 09:56:48', 1, 'project', 'root', 'Contact us', NULL, NULL),
