(1, 'home', 'Trang chủ', 'Home', NULL, NULL, NULL, '<p>[section section=&quot;1&quot; section_name=&quot;section_about&quot;]</p>', NULL, NULL, '', NULL, '', 1, '2022-06-08 13:59:30', '2024-03-12 11:30:03', 1, 'page', 'root', 'One Health Foundation', 'One Health Foundation', 'One Health Foundation'),
(3, 'board-manager', 'Ban giám đốc', 'Board of Director', NULL, NULL, '<p>[staff id=&quot;88&quot;]</p>\r\n\r\n<p>[staff id=&quot;92&quot;]</p>', '<p>&nbsp;[staff id=&quot;88&quot;]</p>\r\n\r\n<p>&nbsp;[staff id=&quot;92&quot;]</p>', NULL, NULL, NULL, '/upload/images/page/banner_bgd.png', NULL, 5, '2024-03-05 14:22:40', '2024-03-12 14:23:48', 1, 'page', 'root', 'Ban giám đốc', NULL, NULL),
(7, 'chung-thuc', 'Chứng thực', 'Chứng thực', NULL, '<p>wfwef</p>', NULL, '<p>sẻhserh</p>', NULL, NULL, NULL, NULL, NULL, 6, '2024-03-05 16:03:18', '2024-03-12 11:15:30', 1, 'page', 'root', 'Chứng thực', NULL, NULL),
(10, 'donate', 'Quyên góp cho One Health Foundation', 'Donate to One Health Foundation', NULL, NULL, '<div class=\"btgrid container\">\r\n<div class=\"row row-1\">\r\n<div class=\"col-md-7\">\r\n<div class=\"content\">\r\n<p data-wpmeteor-mouseover=\"true\">Hãy quyên góp cho chúng tôi để giảm tỷ lệ hộ nghèo ở Việt Nam và xây dựng một hệ thống y tế bền vững cho hàng ngàn người ở Việt Nam.</p>\r\n\r\n<p>Đồng hành cùng One Health Foundation và chúng ta sẽ làm nên lịch sử.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-5\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" src=\"/upload/images/page/donate-img_1.jpg\" style=\"width: 100%;\" /></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>', '<div class=\"btgrid container\">\r\n<div class=\"row row-1\">\r\n<div class=\"col-md-7\">\r\n<div class=\"content\">\r\n<p>Please donate to us to reduce the poverty rate in Vietnam and build a sustainable health system for thousands of people in Vietnam.</p>\r\n\r\n<p>Join One Health Foundation and we will make history.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-5\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" src=\"/upload/images/page/donate-img_1.jpg\" style=\"width: 100%;\" /></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 10, '2024-03-12 11:15:55', '2024-03-12 13:31:51', 1, 'page', 'root', 'Quyên góp', NULL, NULL),
(4, 'du-an', 'Dự án', 'Project', NULL, NULL, '<p>[project items=&quot;3&quot;]</p>', NULL, NULL, NULL, NULL, '/upload/images/page/banner_key_project.jpg', NULL, 9, '2024-03-07 15:40:53', '2024-03-12 11:15:39', 1, 'page', 'root', 'Dự án', NULL, NULL),
(8, 'tai-tro', 'Tài trợ', 'Sponsor', '<p>Ban giám đốc</p>', NULL, '<p>Chân thành cảm ơn các nhà tài trợ đã và đang ủng hộ cho những dự án cũng như hoạt động của chúng tôi.</p>', NULL, NULL, NULL, NULL, '/upload/images/page/banner_sponsor.jpg', NULL, 7, '2024-03-06 08:39:52', '2024-03-12 11:29:24', 1, 'page', 'root', 'Ban giám đốc', NULL, NULL),
(9, 'doi-tac', 'Đối tác', 'Partner', NULL, NULL, '<p>Cảm ơn các đối tác đã đồng hành cùng One Health Foundation để chúng tôi có thể thực hiện những dự án mang tính cộng đồng tại Việt Nam. Giúp đỡ những người dân có hoàn cảnh không may có một cuộc sống tốt hơn và giúp họ nâng cao nhận thức về sức khỏe cũng như là môi trường sống ngày nay.</p>', NULL, NULL, NULL, NULL, '/upload/images/page/banner_partner_1500x343.jpg', NULL, 8, '2024-03-06 08:39:52', '2024-03-12 11:29:33', 1, 'page', 'root', 'Chứng thực', NULL, NULL),
