\r\n\r\n&lt;p&gt;&amp;ndash; Tài trợ tiền và hiện vật cho BTC như đã thỏa thuận.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;ndash; Cung cấp đủ các thông tin cần thiết cho BTC để phục vụ cho quá trình quảng bá hình ảnh.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;LỜI CẢM ƠN&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Xin chân thành cảm ơn sự quan tâm của Quý đơn vị. Chúng tôi hy vọng sẽ sớm nhận được hồi âm từ phía Quý Công ty cũng như sớm được hợp tác trong thời gian sắp tới. Chương trình của chúng tôi sẽkhông thể thành công nếu thiếu sự ủng hộ, hợp tác và đóng góp từ Quý công ty. Một lần nữa, Ban Tổ chức xin gửi lời cảm ơn đến Quý công ty và chúc Quý công ty luôn thành công!&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;secondary&quot;&gt;\r\n&lt;article class=&quot;card rounded bordered&quot;&gt;\r\n&lt;header class=&quot;card__title&quot;&gt;\r\n&lt;h1&gt;Bạn sẽ được gì?&lt;/h1&gt;\r\n&lt;/header&gt;\r\n\r\n&lt;div class=&quot;markdown with-lists padded what_you_get&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;/article&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;article class=&quot;card call-to-action rounded padded text-centered -sticky&quot;&gt;\r\n&lt;div class=&quot;text-center&quot;&gt;\r\n&lt;div class=&quot;cta__message margin-bottom-lg d-none&quot;&gt;Bạn đã sẵn sàng?&lt;/div&gt;\r\n&lt;!--&lt;button type=&quot;button&quot; class=&quot;button btn&quot; data-toggle=&quot;modal&quot; data-target=&quot;#joinCampaign&quot;&gt;Tham Gia&lt;/button&gt;--&gt;&lt;!--&lt;button type=&quot;button&quot; class=&quot;button btn&quot; data-target=&quot;/register/?campaign=bang&quot;&gt;Tham Gia&lt;/button&gt;--&gt;\r\n\r\n&lt;div class=&quot;cta__message margin-bottom-lg&quot;&gt;Bạn đã sẵn sàng?&lt;/div&gt;\r\n&lt;a class=&quot;button btn&quot; href=&quot;/register/?cid=19090&quot; role=&quot;button&quot;&gt;Đăng ký ngay&lt;/a&gt;&lt;/div&gt;\r\n&lt;/article&gt;\r\n&lt;/div&gt;', NULL, '/upload/images/news/DSCF4074-2-scaled.jpg', NULL, NULL, NULL, 1, 3, 'Hướng Dẫn Thiết Kế Quán Cà Phê Phong Cách Boho (Bohemian):', NULL, NULL, 0, '2024-03-04 15:19:26', '2024-01-20 12:23:06', 0),
(2, 'one-health-foundation-participates-in-the-celebration-for-the-people-affected-by-covid-19-and-soil-salinity', 'ONE HEALTH FOUNDATION PARTICIPATES IN THE CELEBRATION FOR THE PEOPLE AFFECTED BY COVID-19 AND SOIL SALINITY', NULL, '&lt;p&gt;ONE HEALTH FOUNDATION PARTICIPATES IN THE CELEBRATION FOR THE PEOPLE AFFECTED BY COVID-19 AND SOIL SALINITY&lt;/p&gt;', NULL, '&lt;div class=&quot;markdown with-lists&quot;&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;/div&gt;', NULL, '/upload/images/news/IMG_5962.png', NULL, NULL, NULL, 1, 2, 'Hướng Dẫn Thiết Kế Cà Phê Theo Kiểu Sân Vườn:', NULL, NULL, 0, '2024-03-06 11:12:28', '2024-01-20 12:24:07', 0),
(3, 'lang-thien-nguyen', 'LÀNG THIỆN NGUYỆN', NULL, '&lt;p&gt;Mô hình &amp;ldquo;Làng Thiện Nguyện&amp;rdquo; được xây dựng trên 60 tỉnh thành Việt Nam sẽ bao gồm cơ sở y tế (Bệnh viện hoặc Phòng Khám Đa Khoa) và cơ sở giáo dục từ Tiểu học tới THPT đảm bảo chất lượng giảng dạy và chi phí phù hợp với thu nhập của người dân địa phương.&lt;/p&gt;', NULL, '&lt;p&gt;Mô hình &amp;ldquo;Làng Thiện Nguyện&amp;rdquo; được xây dựng trên 60 tỉnh thành Việt Nam sẽ bao gồm cơ sở y tế (Bệnh viện hoặc Phòng Khám Đa Khoa) và cơ sở giáo dục từ Tiểu học tới THPT đảm bảo chất lượng giảng dạy và chi phí phù hợp với thu nhập của người dân địa phương. Bên cạnh đó, Làng còn có Viện dưỡng lão và Cô Nhi viện nuôi dưỡng những người già cô đơn và trẻ em mồ côi có hoàn cảnh khó khăn từ nguồn kinh phí phúc lợi xã hội của Bệnh viện và Trường học. One Health Foundation sẽ chịu trách nhiệm quyên góp, gây quỹ để xây dựng và vận hành dự án.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;strong&gt;Quy mô của dự án:&lt;/strong&gt;&lt;br /&gt;\r\n	1.&amp;nbsp; Bệnh viện đa khoa cộng đồng có quy mộ từ 200 tới 400 giường được trang bị các thiết bị kỹ thuật cao. Bệnh viện hoạt động theo cơ chế của bệnh viện tư nhân phục vụ nhu cầu khám, chữa bệnh tại địa phương với chi phí phù hợp với thu nhập của địa phương. Lợi nhuận từ bệnh viện sẽ dành để chăm sóc sức khỏe cho nạn nhân chất độc da cam, người già neo đơn, trẻ em cơ nhỡ và các hộ nghèo của địa phương.&lt;br /&gt;\r\n	2. Trường phổ thông cộng đồng từ cấp tiểu học tới trung học phổ thông với các trang thiết bị giáo dục hiện đại. Các trường học hoạt động theo cơ chế trường dân lập với chi phí phù hợp với thu nhập của địa phương. Lợi nhuận từ trường học sẽ dành để trao các suất học bổng và miễn học phí cho trẻ em mồ côi và có hoàn cảnh khó khăn tại địa phương .&lt;br /&gt;\r\n	3. Viện dưỡng lão có quy mô từ 150 &amp;ndash; 200 giường, hoạt động theo cơ chế viện dưỡng lão tư nhân cung cấp dịch vụ cho người cao tuổi tại địa phương.&lt;br /&gt;\r\n	4. Viện dưỡng lão cộng đồng và cô nhi viện có quy mô nuôi dưỡng, chăm sóc từ 100 tới 200 người già neo đơn và trẻ mồ côi từ nguồn kinh phí của các hạng mục khác trong dự án và quyên góp từ cộng đồng.&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Với sứ mệnh lấy giáo dục và y tế làm trọng tâm, mô hình &amp;rdquo;Làng Thiện Nguyện&amp;rdquo; được xây dựng nhằm mục đích:&lt;/strong&gt;&lt;br /&gt;\r\n	1. Giúp người dân địa phương tiếp cận các dịch vụ y tế, giáo dục dễ dàng thuận lợi hơn.&lt;br /&gt;\r\n	2. Nâng cao chất lượng các dịch vụ chăm sóc sức khỏe và giáo dục tại địa phương.&lt;br /&gt;\r\n	3. Giảm tải cho các cơ sở y tế và giáo dục các thành phố trung ương&lt;br /&gt;\r\n	4. Xử lý các vấn đề về ô nhiễm môi trường, tạo ra năng lượng sạch tại địa phương&lt;br /&gt;\r\n	5. Tạo ra một hệ sinh thái bền vững trợ giúp những hoàn cảnh khó khăn tại địa phương.&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Dự án đặt mục tiêu xây dựng 1 &amp;ldquo;Làng Thiện Nguyện&amp;rdquo; cho mỗi tỉnh thành trên toàn lãnh thổ Việt Nam theo từng giai đoạn.&lt;/strong&gt;&lt;br /&gt;\r\n	1. Giai đoạn 1 từ 2019 tới 2020: Gây quỹ và xây dựng Làng Thiện Nguyện đầu tiên.&lt;br /&gt;\r\n	2. Giai đoạn 2 từ 2021 tới 2025: vận hành Làng Thiện Nguyện số 1 và xây dựng 5 Làng Thiện Nguyện ở các Tỉnh Miền Nam và Nam Trung Bộ.&lt;br /&gt;\r\n	3. Giai Đoạn 3: Xây dựng Làng Thiện Nguyện cho các tỉnh phía Bắc.&lt;/li&gt;\r\n&lt;/ul&gt;', NULL, '/upload/images/campaign/lang_thien_nguyen.png', NULL, NULL, NULL, 1, 1, 'aaa', NULL, NULL, 0, '2024-03-06 14:12:43', '2024-01-23 11:21:23', 0);
