(4, 'chuong-trinh-the-thao-gay-quy-4', 'CHƯƠNG TRÌNH THỂ THAO GÂY QUỸ', NULL, '&lt;p&gt;THƯ NGỎ: VỀ VIỆC TÀI TRỢ CHƯƠNG TRÌNH THỂ THAO GÂY QUỸ TỪ THIỆN Kính gửi: Quý công ty, đơn vị, doanh nghiệp Lời đầu tiên, đơn vị tổ chức One Health Foundation xin gửi lời chào trân trọngvà lời chúc sức khỏe đến các các quý công ty, đơn vị, doanh nghiệp. Trước hết, [...]&lt;/p&gt;', NULL, '&lt;div class=&quot;clearfix bg-white&quot;&gt;\r\n&lt;div class=&quot;default-container margin-lg pitch-landing-page&quot;&gt;\r\n&lt;div class=&quot;campaign-page&quot;&gt;\r\n&lt;div class=&quot;primary&quot;&gt;\r\n&lt;div class=&quot;markdown with-lists&quot;&gt;\r\n&lt;p&gt;THƯ NGỎ: VỀ VIỆC TÀI TRỢ CHƯƠNG TRÌNH THỂ THAO GÂY QUỸ TỪ THIỆN&lt;/p&gt;\r\n\r\n&lt;p&gt;Kính gửi: Quý công ty, đơn vị, doanh nghiệp Lời đầu tiên, đơn vị tổ chức &lt;strong&gt;One Health Foundation&lt;/strong&gt; xin gửi lời chào trân trọngvà lời chúc sức khỏe đến các các quý công ty, đơn vị, doanh nghiệp. Trước hết, đơn vị tổ chức &lt;strong&gt;One Health Foundation&lt;/strong&gt; chúng tôi xin chân thành cảm ơncác quý công ty, đơn vị, doanh nghiệp đã dành thời gian để đọc bản kế hoạch này.&lt;/p&gt;\r\n\r\n&lt;p&gt;Sự kiện thể thao là một sự kiện thường niên đầy ý nghĩa dành cho tất cả các lứa tuổi hiện nay, với rất nhiều những hoạt động bổ ích, vui vẻ chắc chắn sẽ đem đến cho người tham gia một sân chơi đầy sôi nổi và nhiều khoảnh khắc đáng nhớ.&lt;/p&gt;\r\n\r\n&lt;p&gt;Tập hồ sơ này trình bày về việc hợp tác giữa Quý đơn vị với đơn vị tổ chức &lt;strong&gt;One Health Foundation&lt;/strong&gt; trong chương trình. Việc hợp tác này sẽ được cụ thể bởi một kế hoạch tài trợ về mặt tổ chức và mặt tài chính hoặc vật chất đối với sự kiện của chúng tôi. Sau khi đọc hết tập hồ sơ này, chắc chắn Quý đơn vị sẽ nhận thấy việc hợp tác và đồng hành cùng chúng tôi trong lễ hội là một điều tuyệt vời dành cho tuổi trẻ. Thương hiệu của Quý đơn vị sẽ tiếp cận với hơn 10.000 người. Hơn nữa, giá trị đạt được ở đây còn là sự biết đến của xã hội về những đóng góp của quý đơn vị dành cho cả thế hệ trẻ Việt Nam, không chỉ thu hút giới trẻ, một lượng lớn người tham gia là các gia đình với ông bà và trẻ nhỏ. Điều này dễ hiểu vì đây là sự kiện thể thao ngoài trời lành mạnh dành cho mọi lứa tuổi.&lt;/p&gt;\r\n\r\n&lt;p&gt;Để chương trình tổ chức thành công tốt đẹp, chúng tôi rất mong nhận được sự quan tâm giúp đỡ từ Quý đơn vị và quan trọng là sự kết nối, hợp tác lâu, đồng hành lâu dài trong tương lai. Xin chân thành cảm ơn !&lt;/p&gt;\r\n\r\n&lt;p&gt;Quỹ từ thiện sức khỏe là số 1 hay One Health Foundation (OHF) là một tổ chức phi chính phủ, được khấu trừ thuế và được cấp phép hoạt động tại Việt Nam. Quỹ được thành lập vào năm 2018 bởi ông Nguyễn Huỳnh Đăng Khoa. OHF hoạt động với mục tiêu giúp người dân thoát nghèo bền vững bằng cách tạo cơ hội cho những người dân ở vùng xa đều có khả năng tiếp cận với các dịch vụ xã hội cơ bản về y tế và giáo dục thông qua các dự án của quỹ. Trong tương lai, những chương trình của OHF sẽ tiếp cận và giúp đỡ hàng ngàn hoàn cảnh khó khăn ở 63 tỉnh thành mỗi năm.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;LÍ DO&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Không phải ngẫu nhiên mà chúng tôi lại chọn cuộc thi chạy Marathon, ngoài việc mang sự sáng tạo nó còn đi đôi với việc khuyến khích mọi người tích cực rèn luyện sức khỏe. Như chúng ta đã biết, chạy bộ được các bác sĩ, nhà nghiên cứu chứng minh được là hình thức tập luyện thể thao tốt nhất cho cơ thể, nó mang lại những thay đổi rõ rệt một cách tích cực cho sức khỏe chúng ta như: giảm nguy cơ mắc bệnh tim mạch, giúp xương khỏe mạnh và giảm cân hiệu quả, giảm stress, tăng tuổi thọ, &amp;hellip; Do đó, giải chạy Marathon được One Health Foundation chọn để vận động mọi người, mọi&amp;nbsp; người vận&amp;nbsp; động những người khác nữa cùng nhau chạy, vì một sức khỏe tốt, vì một chất lượng cuộc sống tốt.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;MỤC ĐÍCH&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Khuyến khích hoạt động thể chất:&lt;/strong&gt; Chương trình tạo điều kiện để mọi người tham gia vào hoạt động chạy bộ, thúc đẩy sự rèn luyện cơ thể và khích lệ mọi người duy trì một lối sống lành mạnh và hoạt động thể chất.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Kết nối cộng đồng:&lt;/strong&gt; Chương trình cũng là một dịp để cộng đồng tương tác, gặp gỡ và tạo mối quan hệ mới. Người tham gia có thể chạy cùng nhau, tạo đội hình hoặc gặp gỡ bạn bè và gia đình trong một không gian vui tươi và thoải mái.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Tạo tâm điểm từ thiện:&lt;/strong&gt; Sự kiện thường quyên góp một phầnthu nhập cho các tổ chức từ thiện và các dự án xã hội. Điều này giúp xã hội đóng góp vào mục tiêu tốt đẹp và khuyến khích người tham gia cảm thấy có ý nghĩa và hài lòng khi tham gia sự kiện.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;ĐỐI TƯỢNG KHÁCH HÀNG&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Người yêu thích hoạt động thể thao:&lt;/strong&gt; Sự kiện thu hút những người có đam mê về chạy bộ và hoạt động thể thao.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Nhóm bạn, gia đình và người thân: &lt;/strong&gt;Cung cấp cơ hội cho nhóm bạn, gia đình và người thân tận hưởng thời gian vui chơi và tạo kỷ niệm.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Người muốn ủng hộ từ thiện:&lt;/strong&gt; Một số người tham gia chương trình cũng quan tâm đến khía cạnh từ thiện của sự kiện, nơi một phần thu nhập được quyên góp cho các tổ chức từ thiện và dự án xã hội.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Người muốn ủng hộ từ thiện:&lt;/strong&gt; Một số người tham gia cũng quan tâm đến khía cạnh từ thiện của sự kiện, nơi một phần thu nhập được quyên góp cho các tổ chức từ thiện và dự án xã hội.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;THỜI GIAN VÀ ĐẠI ĐIỂM&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Địa điểm: Phú Mỹ Hưng, Q7 TP. Hồ Chí Minh&lt;/p&gt;\r\n\r\n&lt;p&gt;Cự ly: 3 &amp;ndash; 5km&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;TIMELINE SỰ KIỆN&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;figure class=&quot;wp-block-table&quot;&gt;\r\n&lt;table&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;STT&lt;/td&gt;\r\n			&lt;td&gt;GIAI ĐOẠN&lt;/td&gt;\r\n			&lt;td&gt;THỜI GIAN&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;HOẠT ĐỘNG CHÍNH&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;1&lt;/td&gt;\r\n			&lt;td&gt;TRONG BUỔI LỄ RA MẮT &amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp; 2 tiếng&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;&amp;ndash; Khai mạc buổi lễ đường đua. Bao gồm giới thiệu về đường đua, ban tổ chức, nhà tài trợ các giải, về hiện kim và hiện vật. Quảng cáo sản phẩm của nhà tài trợ đôi nét&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;2&lt;/td&gt;\r\n			&lt;td&gt;TRONG GIẢI CHẠY&lt;/td&gt;\r\n			&lt;td&gt;2 tiếng&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;&amp;ndash; Mở khu vực nhận Race Kit.&lt;br /&gt;\r\n			&amp;ndash; Kiểm tra check in người tham dự có đeo vòng an ninh của chương trình&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;2 tiếng&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;&amp;ndash; Mở khu vực trải nghiệm về các gian hàng của các nhà tài trợ, đi chụp hình,&amp;hellip;&lt;br /&gt;\r\n			&amp;ndash; Người tham gia có thể đi xem các sản phẩm mà nhà tài trợ bày bán.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;25 phút&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;&amp;ndash; Thông báo buổi lễ khai mạc đường chạy &amp;ndash; Giới thiệu đôi nét về chạy marathon cũng như ý nghĩa tổ chức chương trình.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;5 phút&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;BTC tuyên bố khai mạc đường đua.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;2 tiếng&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;&amp;ndash; Bắt đầu giải chạy&lt;br /&gt;\r\n			&amp;ndash; Cập nhật người tham gia chạy đến đoạn đường nào&lt;br /&gt;\r\n			&amp;ndash; Chụp ảnh, quay phim lại khoảnh khắc quý giá của người tham gia.&lt;br /&gt;\r\n			&amp;ndash; Cổ động viên, các nhóm tiếp sức nước sẵn sàng vị trí.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;30 phút&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;&amp;ndash; Kết thúc đường chạy&lt;br /&gt;\r\n			&amp;ndash; Thông báo thời gian nghỉ giải lao&amp;nbsp; cho các thí sinh nghỉ ngơi, lấy lại sức.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;5&lt;/td&gt;\r\n			&lt;td&gt;BẾ MẠC CHƯƠNG TRÌNH&lt;/td&gt;\r\n			&lt;td&gt;5p&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;BTC tuyên bố bế mạc chương trình.&lt;br /&gt;\r\n			Trao giải và tri ân nhà tài trợ và ngươi tham gia.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;45p&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;Hướng dẫn và kiểm soát khu vực người tham dự ra về trật tự. Tránh tình trạng ùn đẩy, mất trật tự, thất lạc đối với gia đình có trẻ nhỏ. &amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;/figure&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;ĐỘI NGŨ NHÂN SỰ:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;figure class=&quot;wp-block-table&quot;&gt;\r\n&lt;table&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&lt;strong&gt;STT&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Người phụ trách&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;MÔ TẢ CÔNG VIỆC&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;1&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;ÂM NHẠC&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;ndash; Mở nhạc sôi động&lt;br /&gt;\r\n			&amp;ndash; Đảm bảo chất lượng âm thanh tốt nhất cho người nghe&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;2&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;ÁNH SÁNG&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;ndash; Ánh sáng đèn rõ, hoạt động chiếu sáng hết công suất. Đảm bảo được chất lượng đèn trong suốt quá trình buổi biểu diễn.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;3&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;HÌNH ẢNH&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;ndash; Chiếu background chương trình- Chiếu các video/ hình ảnh logo về nhà tài trợ chính của chương trình.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;ndash; Chiếu slide giới thiệu về ban tổ chức, đơn vị đối tác.&lt;br /&gt;\r\n			&amp;ndash; Chiếu slide các khu vực trò chơi&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;ndash; Chiếu cảnh người chạy đang chuẩn bị xuất phát.&lt;br /&gt;\r\n			&amp;ndash; Chiếu cảnh người tham dự đang vượt qua thử thách hoàn thành chặng đường.&lt;br /&gt;\r\n			&amp;ndash; Chiếu ảnh các trạm đang tiếp sức cho người chạy.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;4&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;QUAY PHIM &amp;amp; CHỤP HÌNH&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;ndash; Ghi hình và kiểm tra chất lượng ảnh.&lt;br /&gt;\r\n			&amp;ndash; Quay toàn cảnh&lt;br /&gt;\r\n			&amp;ndash; Quay focus&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;5&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;HẬU ĐÀI&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;ndash; Kiểm tra đồ ăn và nước uống đã được chuẩn bị trong khu vực ăn uống&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;6&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;QUẢN LÝ NHẬN SỰ (MC, PG &amp;ndash; người giám sát sự kiện, KOL)&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;ndash; Phân công nhân lực ở khu vực check-in vé, đảm bảo người tham dự đều có vòng tay an ninh.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;7&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;ĐỊA ĐIỂM &amp;amp; ĐỒ ĂN UỐNG&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Sẵn sàng phục vụ đồ ăn thức uống.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;8&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;PG &amp;amp; KOL&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;PG đứng kiểm tra ở khu vực check &amp;ndash; in vé.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;PG phân bố đứng ở khu vực có người tham dự.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Ca sĩ, khách mời chuẩn bị sẵn sàng cho phần trình diễn của mình.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;9&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;KHU VỰC CHECK IN&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;ndash; Đón những người tham gia chương trình tại cổng chính và hướng dẫn đến khu vực Check-in.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;ndash; Tại khu vực Check &amp;ndash; in, BTC sẽ gửi bộ kit bao gồm: giày, áo in logo sự kiện, vòng tay an ninh, hai túi bột màu của chương trình.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Hỗ trợ người tham gia check in với vật phẩm của chương trình.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td class=&quot;has-text-align-center&quot; data-align=&quot;center&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Hướng dẫn vòng đeo tay an ninh có trong bộ kit.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;/figure&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;MỤC TIÊU TỔ CHỨC&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Với mục tiêu mang lại cuộc sống an lành, mạnh khỏe cho tất cả mọi người, giúp mọi người tự theo dõi sức khỏe bản thân, phát hiện sớm các bệnh từ đó đưa ra phương pháp điều trị cũng như lên kế hoạch chăm sóc phù hợp. Ngoài việc khám, chữa bệnh, các bác sĩ còn tư vấn thông tin cần thiết về tình hình sức khỏe, hướng dẫn cho người bệnh tự theo dõi tình hình sức khỏe của bản thân mình để tự phòng bệnh.&lt;/p&gt;\r\n\r\n&lt;p&gt;Qua đó đã giúp đỡ, chia sẽ khó khăn, giảm bớt 1 phần chi phí chữa bệnh hàng năm cho bà con nghèo. Chương trình cũng mang lại hiệu quả tích cực, góp phần chung tay cùng cộng đồng chăm sóc sức khỏe cho nhân dân, đặc biệt là những người nghèo thuộc vùng sâu vùng xa.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Thông điệp truyền thông:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;ldquo;&lt;em&gt;Chạy vì sức khỏe, chạy vì cộng đồng, chạy vì tương lai&amp;rdquo;&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Hình thức online : Trang web chính thức, fanpage của chương trình, nhà tài trợ hợp tác, Tiktok, Youtube, các trang báo chính thống như Vnexpress, báo Dân trí,&amp;hellip;&lt;/li&gt;\r\n	&lt;li&gt;Hình thức offline: Treo banner, standee, tờ rơi, poster.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Chi tiết kế hoạch (dự kiến):&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Đối tượng truyền thông: 10.000 người&lt;/p&gt;\r\n\r\n&lt;p&gt;Mục tiêu: Lượt tiếp cận &amp;gt;10.000 người/ 1 bài viết | Lượt tương tác &amp;gt; 800/ 1 bài viết ( Trên fanpage, insta, tik tok,&amp;hellip;)&lt;/p&gt;\r\n\r\n&lt;figure class=&quot;wp-block-table&quot;&gt;\r\n&lt;table&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;STT&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;THỜI GIAN ĐĂNG BÀI&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;&lt;strong&gt;NỘI DUNG&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;&lt;strong&gt;PHƯƠNG TIỆNTRUYỀN THÔNG&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;1&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;Đăng bài chính thức phát động chương trình&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;Tất cả các nền tảng mạng xã hội của chương trình. (FB, Tiktok, Youtube, Instagram,&amp;hellip;)&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;2&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td class=&quot;has-text-align-left&quot; data-align=&quot;left&quot;&gt;Giới thiệu các nhà tài trợ chính thức trong chương trình lầ