(1, 30, NULL, 'goi-setup-tron-goi', NULL, 'Gói Setup trọn gói', NULL, '&lt;p&gt;abc&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/upload/files/z5072168725600_398ee8e040a805cb7848bc010d7ecc0f.jpg&quot; style=&quot;width: 1280px; height: 853px;&quot; /&gt;&lt;/p&gt;', NULL, '&lt;p&gt;Gói setup phù hợp với anh/chị chủ quán có ngân sách tầm trung.&lt;/p&gt;\r\n\r\n&lt;h6&gt;NGÀY 01&lt;/h6&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Demo sản phẩm tại trung tâm Vietblend.&lt;br /&gt;\r\n&amp;nbsp;Lên và chốt menu cho quán.&lt;br /&gt;\r\n&amp;nbsp;Hướng dẫn cho khách hàng và nhân viên quán.&lt;/p&gt;\r\n\r\n&lt;h6&gt;NGÀY 02,03,04&lt;/h6&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Đào tạo nhân viên trực tiếp tại quán.&lt;/p&gt;\r\n\r\n&lt;p&gt;Hiểu được sự quan trọng của nhân viên &amp;ndash; người trực tiếp tiếp xúc với khách hàng. Vietblend trực tiếp đào tạo đội ngũ nhân viên theo tác phong và quy trình chuyên nghiệp dần ổn định xu hướng hoạt động sau này, thuận tiện nhất cho anh/chị chủ quán.&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;/upload/files/a9d109cc4d80edaec0e10c068b3107f5_output.jpeg&quot; style=&quot;width: 1080px; height: 810px;&quot; /&gt;&lt;/p&gt;', NULL, NULL, '/upload/files/310649627_1158336221693426_4779608687322342709_n.jpg', NULL, NULL, NULL, 1, 1, NULL, '3000000', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Gói Setup trọn gói', NULL, NULL, '2024-01-18 12:04:35', '2024-01-18 12:04:35');
